package main

import (
	"fmt"
	"log"
	"os"
	"runtime/pprof"
)

/*
查看下打印日志对性能的影响
*/

var N int

func main() {
	f, err := os.Create(".cpu.prof")
	if err != nil {
		log.Fatal(err)
	}
	defer f.Close()
	pprof.StartCPUProfile(f)
	defer pprof.StopCPUProfile()

	N = 4000

	go demo1()
	go demo2()
	go demo3()
	go demo4()
	go demo5()
}

func demo1() {
	for i := 0; i < N; i++ {
		log.Println("0")
	}
}

func demo2() {
	for i := 0; i < N; i++ {
		log.Println("0123456789")
	}
}

func demo3() {
	for i := 0; i < N; i++ {
		fmt.Println("0123456789012345678901234567890123456789012345678901234567890123456789012345678901234567890123456789")

	}
}
func demo4() {
	for i := 0; i < N; i++ {
		fmt.Println("")

	}
}
func demo5() {
	for i := 0; i < N; i++ {
		fmt.Println("")

	}
}
